import styled from "styled-components"

export const Button = styled.button`
    position: fixed;
    left: 50px;
    right: 50px;
    width: 50px;
    height: 50px;
    font-size: 40px;
    background-color: #fff;
    border-radius: 25px;
    box-shadow: 2px 2px 20px 1px #000;
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
`
